Seguem informações:

- A massa utilizada foi 35424575 (telefone nulo);
- No Genesys, o agente CAC2 está com a skill de atualização cadastral e comercial (necessária para o ATH, já que eu entrei pela jornada de falar com o agente);
- Agente CAC1 não possui skill de atualização cadastral; removi até mesmo a fila de atualização cadastral;
- Desativei, no data table, o roteamento de atipicidade para Elektro, tendo em vista que essa regra sobrepõe todas as outras do roteamento, incluindo a da Ilha de Atualização Cadastral;
- Removi o agente CAC1 da fila e mantive apenas o agente CAC2. Nesse caso, a chamada não foi atendida.

‌

Poderiam me apoiar, por gentileza?

Se for o caso, podemos realizar uma agenda para realizar testes em conjunto.

